import React, { Component } from 'react';
class Home extends Component {
  render() {
    return (
        <div class="row">
            <div class="col">
                <a href="/Smart-List-React/"><img src="https://img.icons8.com/android/24/000000/left.png" ></img></a>
            </div>
            <div class="col">
            <a href="/Smart-List-React/"><img src="https://img.icons8.com/material-outlined/48/000000/home--v2.png"></img></a>
            </div>
            <div class="col">
                <a href="/Smart-List-React/"><img src="https://img.icons8.com/android/48/000000/logout-rounded-down.png"></img></a>
            </div>
            <div class="circle">
                <div class="circle1" id="c1"></div>
                <div class="circle1" id="c2"></div>
                <div class="circle1" id="c3"></div>
                <div class="circle1" id="c4"></div>
                <div class="circle1" id="c5"></div>
            </div>
        </div>
    );
  }
}

export default Home;
